class Solution(object):
    def minimumCost(self, source, target, original, changed, cost):
        n = len(source)
        dp = [[float('inf')] * (n + 1) for _ in range(n + 1)]
        dp[0][0] = 0

        for i in range(n + 1):
            for j in range(i, n + 1):
                if dp[i][j] < float('inf'):
                    if j < n and source[j] == target[j]:
                        dp[i][j + 1] = min(dp[i][j + 1], dp[i][j])
                    for k in range(len(original)):
                        if original[k] == source[j:j + len(original[k])] and j + len(original[k]) <= n and target.startswith(changed[k], j) and (i <= j or (i > j and changed[k] == target[i:i + len(changed[k])])):
                            dp[j + len(original[k])][j + len(original[k])] = min(dp[j + len(original[k])][j + len(original[k])], dp[i][j] + cost[k])

        return dp[n][n] if dp[n][n] != float('inf') else -1
